import EventEmitter2 from 'eventemitter2'
import { NanoresourcePromise as Nanoresource } from './index.js'

const kNanoresource = Symbol('nanoresource')

export class NanoresourcePromise extends EventEmitter2 {
  constructor (opts = {}) {
    const { open, close, reopen, ...ee } = opts

    super(ee)

    const _open = open || this._open.bind(this)
    const _close = close || this._close.bind(this)

    this._emitOpened = null
    this._emitClosed = null

    this[kNanoresource] = new Nanoresource({
      open: async () => {
        await this.emitAsync('open')
        await _open()
      },
      close: async () => {
        await this.emitAsync('close')
        await _close()
      },
      reopen
    })
  }

  get opened () {
    return this[kNanoresource].opened
  }

  get opening () {
    return this[kNanoresource].opening
  }

  get closed () {
    return this[kNanoresource].closed
  }

  get closing () {
    return this[kNanoresource].closing
  }

  get actives () {
    return this[kNanoresource].actives
  }

  /**
   * @returns {Promise}
   */
  async open () {
    await this[kNanoresource].open()
    if (!this._emitOpened) {
      this._emitOpened = this.emitAsync('opened')
      this._emitClosed = null
    }
    await this._emitOpened
  }

  /**
   * @returns {Promise}
   */
  async close (allowActive) {
    await this[kNanoresource].close(allowActive)
    if (!this._emitClosed) {
      this._emitClosed = this.emitAsync('closed')
      this._emitOpened = null
    }
    await this._emitClosed
  }

  /**
   * @returns {boolean}
   */
  active (cb) {
    return this[kNanoresource].active(cb)
  }

  /**
   * @returns {boolean}
   */
  inactive (cb, err, value) {
    return this[kNanoresource].inactive(cb, err, value)
  }

  /**
   * @abstract
   */
  async _open () {}

  /**
   * @abstract
   */
  async _close () {}
}
/**
 *
 * This code is based on the @mafintosh work.
 * https://github.com/mafintosh/nanoresource
 */

import nextTick from 'proc-nexttick'

const preopening = Symbol('opening when closing')
const opening = Symbol('opening queue')
const preclosing = Symbol('closing when inactive')
const closing = Symbol('closing queue')
const sync = Symbol('sync')
const fastClose = Symbol('fast close')
const reopen = Symbol('allow reopen')
const init = Symbol('init state')

function noop () {}

export class Nanoresource {
  constructor (opts) {
    if (!opts) opts = {}
    if (opts.open) this._open = opts.open
    if (opts.close) this._close = opts.close

    this[init]()

    this[reopen] = opts.reopen || false
    this[preopening] = null
    this[opening] = null
    this[preclosing] = null
    this[closing] = null
    this[sync] = false
    this[fastClose] = true
  }

  [init] () {
    this.opening = false
    this.opened = false
    this.closing = false
    this.closed = false
    this.actives = 0
  }

  _open (cb) {
    cb(null)
  }

  _close (cb) {
    cb(null)
  }

  open (cb) {
    if (!cb) cb = noop

    if (this.closing || this.closed) {
      if (!this[reopen]) {
        return nextTick(cb, new Error('Resource is closed'))
      }

      if (this.closing) {
        if (!this[preopening]) this[preopening] = []
        this[preopening].push(cb)
        return
      }

      this[init]()
    }

    if (this.opened) return nextTick(cb)

    if (this[opening]) {
      this[opening].push(cb)
      return
    }

    this.opening = true
    this[opening] = [cb]
    this[sync] = true
    this._open(onopen.bind(this))
    this[sync] = false
  }

  active (cb) {
    if ((this[fastClose] && this[preclosing]) || this[closing] || this.closed) {
      if (cb) nextTick(cb, new Error('Resource is closed'))
      return false
    }
    this.actives++
    return true
  }

  inactive (cb, err, val) {
    if (!--this.actives) {
      const queue = this[preclosing]
      if (queue) {
        this[preclosing] = null
        while (queue.length) this.close(queue.shift())
      }
    }

    if (cb) cb(err, val)
  }

  close (allowActive, cb) {
    if (typeof allowActive === 'function') return this.close(false, allowActive)
    if (!cb) cb = noop

    if (allowActive) this[fastClose] = false

    if (this.closed) return nextTick(cb)

    if (this.actives || this[opening]) {
      if (!this[preclosing]) this[preclosing] = []
      this[preclosing].push(cb)
      return
    }

    if (!this.opened) {
      this.closed = true
      nextTick(cb)
      return
    }

    if (this[closing]) {
      this[closing].push(cb)
      return
    }

    this.closing = true
    this[closing] = [cb]
    this[sync] = true
    this._close(onclose.bind(this))
    this[sync] = false
  }
}

function onopen (err) {
  if (this[sync]) return nextTick(onopen.bind(this), err)

  const oqueue = this[opening]
  this[opening] = null
  this.opening = false
  this.opened = !err

  while (oqueue.length) oqueue.shift()(err)

  const cqueue = this[preclosing]
  if (cqueue && !this.actives) {
    this[preclosing] = null
    while (cqueue.length) this.close(cqueue.shift())
  }
}

function onclose (err) {
  if (this[sync]) return nextTick(onclose.bind(this), err)
  const queue = this[closing]
  this.closing = false
  this[closing] = null
  this.closed = !err
  while (queue.length) queue.shift()(err)

  const cqueue = this[preopening]
  if (cqueue) {
    this[preopening] = null
    while (cqueue.length) this.open(cqueue.shift())
  }
}
import { Nanoresource } from './nanoresource-cb.js'

function callbackPromise () {
  let callback

  const promise = new Promise((resolve, reject) => {
    callback = (err, value) => {
      if (err) reject(err)
      else resolve(value)
    }
  })

  callback.promise = promise
  return callback
}

const kNanoresource = Symbol('nanoresource')

export class NanoresourcePromise {
  constructor (opts = {}) {
    const open = opts.open || this._open.bind(this)
    const close = opts.close || this._close.bind(this)

    this[kNanoresource] = new Nanoresource({
      open: (cb) => processPromise(open, cb),
      close: (cb) => processPromise(close, cb),
      reopen: opts.reopen
    })
  }

  get opened () {
    return this[kNanoresource].opened
  }

  get opening () {
    return this[kNanoresource].opening
  }

  get closed () {
    return this[kNanoresource].closed
  }

  get closing () {
    return this[kNanoresource].closing
  }

  get actives () {
    return this[kNanoresource].actives
  }

  /**
   * @returns {Promise}
   */
  open () {
    const callback = callbackPromise()
    this[kNanoresource].open(callback)
    return callback.promise
  }

  /**
   * @returns {Promise}
   */
  close (allowActive = false) {
    const callback = callbackPromise()
    this[kNanoresource].close(allowActive, callback)
    return callback.promise
  }

  /**
   * @returns {boolean}
   */
  active (cb) {
    return this[kNanoresource].active(cb)
  }

  /**
   * @returns {boolean}
   */
  inactive (cb, err, value) {
    return this[kNanoresource].inactive(cb, err, value)
  }

  /**
   * @abstract
   */
  async _open () {}

  /**
   * @abstract
   */
  async _close () {}
}

async function processPromise (fnPromise, cb) {
  try {
    await fnPromise()
    cb()
  } catch (err) {
    cb(err)
  }
}
